def genName():
    names_c = len(NAMES)
    rnd_name_n = random.randint(1, names_c)
    name = NAMES[rnd_name_n]

    patronims_c = len(PATRONIMS)
    rnd_patronim_n = random.randint(1, patronims_c)
    patronim = PATRONIMS[rnd_patronim_n]

    # generic = Generic(locale=Locale.RU)

    fnl_str = "{} {}".format(name, patronim)
    return fnl_str

